import { Navbar, Container, Nav } from "react-bootstrap";
import { Envelope, Linkedin, Github } from "react-bootstrap-icons";
import Pdf from "../../documents/Resume.pdf";
import "../NavBar/NavBar.css";

export const NavBar = () => {
  return (
    // bg="dark" variant="dark"
    <Navbar Id="navbar">
      <Container>
        <Navbar.Brand href="#home">Melissa Hookey</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="justify-content-end">
            <Nav.Link href="#about">About</Nav.Link>
            <Nav.Link href={Pdf} target="_blank">
              Resume
            </Nav.Link>
            <Nav.Link id="emailBtn" onclick="showForm();">
              <Envelope></Envelope>
              <form id="formElement"></form>
            </Nav.Link>
            <Nav.Link href="https://github.com/melissahookey" target="_blank">
              <Github></Github>
            </Nav.Link>
            <Nav.Link
              href="https://www.linkedin.com/in/melissahookey/"
              target="_blank"
            >
              <Linkedin></Linkedin>
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBar;
